void ShiftRows(uint8_t state[16])
{
  const int shifts[16] = {
     0,  5, 10, 15,
     4,  9, 14,  3,
     8, 13,  2,  7,
    12,  1,  6, 11,
  };

  const uint8_t in[16] = {
    state[ 0], state[ 1], state[ 2], state[ 3],
    state[ 4], state[ 5], state[ 6], state[ 7],
    state[ 8], state[ 9], state[10], state[11],
    state[12], state[13], state[14], state[15],
  };

  for (int i = 0; i < 16; i++)
    state[i] = in[shifts[i]];
}

void print_state(int round, uint8_t state[16]) {
    printf("State after round %2d: ", round);
    for (int i = 0; i < 16; i++) {
        printf("%02X", state[i]);
    }
    printf("\n");
}

void Cipher(uint8_t in[16])
{
  for (int r = 0; r <= 0; r++) {
    ShiftRows(in);

    for (int j = 0; j < 4; ++j) {
      uint8_t n0, n1, n2, n3;
      uint32_t aa, bb, cc, dd;

      aa = Tyboxes[r][j*4 + 0][in[j*4 + 0]],
      bb = Tyboxes[r][j*4 + 1][in[j*4 + 1]],
      cc = Tyboxes[r][j*4 + 2][in[j*4 + 2]],
      dd = Tyboxes[r][j*4 + 3][in[j*4 + 3]];

      n0 = Xor[0][0][(aa >> 28) & 0xf][(bb >> 28) & 0xf];
      n1 = Xor[0][0][(cc >> 28) & 0xf][(dd >> 28) & 0xf];
      n2 = Xor[0][0][(aa >> 24) & 0xf][(bb >> 24) & 0xf];
      n3 = Xor[0][0][(cc >> 24) & 0xf][(dd >> 24) & 0xf];
      in[j*4 + 0] = (Xor[0][0][n0][n1] << 4) | Xor[0][0][n2][n3];

      n0 = Xor[0][0][(aa >> 20) & 0xf][(bb >> 20) & 0xf];
      n1 = Xor[0][0][(cc >> 20) & 0xf][(dd >> 20) & 0xf];
      n2 = Xor[0][0][(aa >> 16) & 0xf][(bb >> 16) & 0xf];
      n3 = Xor[0][0][(cc >> 16) & 0xf][(dd >> 16) & 0xf];
      in[j*4 + 1] = (Xor[0][0][n0][n1] << 4) | Xor[0][0][n2][n3];

      n0 = Xor[0][0][(aa >> 12) & 0xf][(bb >> 12) & 0xf];
      n1 = Xor[0][0][(cc >> 12) & 0xf][(dd >> 12) & 0xf];
      n2 = Xor[0][0][(aa >>  8) & 0xf][(bb >>  8) & 0xf];
      n3 = Xor[0][0][(cc >>  8) & 0xf][(dd >>  8) & 0xf];
      in[j*4 + 2] = (Xor[0][0][n0][n1] << 4) | Xor[0][0][n2][n3];

      n0 = Xor[0][0][(aa >>  4) & 0xf][(bb >>  4) & 0xf];
      n1 = Xor[0][0][(cc >>  4) & 0xf][(dd >>  4) & 0xf];
      n2 = Xor[0][0][(aa >>  0) & 0xf][(bb >>  0) & 0xf];
      n3 = Xor[0][0][(cc >>  0) & 0xf][(dd >>  0) & 0xf];
      in[j*4 + 3] = (Xor[0][0][n0][n1] << 4) | Xor[0][0][n2][n3];

      aa = MBL[r][j*4 + 0][in[j*4 + 0]];
      bb = MBL[r][j*4 + 1][in[j*4 + 1]];
      cc = MBL[r][j*4 + 2][in[j*4 + 2]];
      dd = MBL[r][j*4 + 3][in[j*4 + 3]];

      n0 = Xor[0][0][(aa >> 28) & 0xf][(bb >> 28) & 0xf];
      n1 = Xor[0][0][(cc >> 28) & 0xf][(dd >> 28) & 0xf];
      n2 = Xor[0][0][(aa >> 24) & 0xf][(bb >> 24) & 0xf];
      n3 = Xor[0][0][(cc >> 24) & 0xf][(dd >> 24) & 0xf];
      in[j*4 + 0] = (Xor[0][0][n0][n1] << 4) | Xor[0][0][n2][n3];

      n0 = Xor[0][0][(aa >> 20) & 0xf][(bb >> 20) & 0xf];
      n1 = Xor[0][0][(cc >> 20) & 0xf][(dd >> 20) & 0xf];
      n2 = Xor[0][0][(aa >> 16) & 0xf][(bb >> 16) & 0xf];
      n3 = Xor[0][0][(cc >> 16) & 0xf][(dd >> 16) & 0xf];
      in[j*4 + 1] = (Xor[0][0][n0][n1] << 4) | Xor[0][0][n2][n3];

      n0 = Xor[0][0][(aa >> 12) & 0xf][(bb >> 12) & 0xf];
      n1 = Xor[0][0][(cc >> 12) & 0xf][(dd >> 12) & 0xf];
      n2 = Xor[0][0][(aa >>  8) & 0xf][(bb >>  8) & 0xf];
      n3 = Xor[0][0][(cc >>  8) & 0xf][(dd >>  8) & 0xf];
      in[j*4 + 2] = (Xor[0][0][n0][n1] << 4) | Xor[0][0][n2][n3];

      n0 = Xor[0][0][(aa >>  4) & 0xf][(bb >>  4) & 0xf];
      n1 = Xor[0][0][(cc >>  4) & 0xf][(dd >>  4) & 0xf];
      n2 = Xor[0][0][(aa >>  0) & 0xf][(bb >>  0) & 0xf];
      n3 = Xor[0][0][(cc >>  0) & 0xf][(dd >>  0) & 0xf];
      in[j*4 + 3] = (Xor[0][0][n0][n1] << 4) | Xor[0][0][n2][n3];
    }
    
    print_state(r + 1, in);  // 중간 상태 출력
  }

  ShiftRows(in);

  for (int i = 0; i < 16; i++)
    in[i] = TboxesLast[i][in[i]];
}

int main(int argc, char* argv[])
{
  uint8_t ptct[16] = { 0, };

  if (2 > argc) {
    fprintf(0, "Usage : %s <16 Byte hex plaintext>", argv[0]);
    return 0;
  }

  if ((16 << 1) != strlen(argv[1])) {
    fprintf(0, "Enter 16 Byte hex plaintext");
    return 0;
  }

  for (size_t i = 0; i < 16; i++) {
    sscanf(argv[1] + i * 2, "%2hhx", ptct + i);
  }

  Cipher(ptct);

  for (size_t i = 0; i < 16; i++) {
    printf("%02X", ptct[i]);
  }
  printf("\n");

  return 0;
}
